app.factory("checkEnter", function()
{ 
  var jsonImages={"returnCode":0,"images": []};
  var jsonDescarga={"returnCode":0,"array":[]};
  var jsonExisteArchivo={"returnCode":0,"array":[]};
  
  return{
    getTotal:function(){
      return jsonDescarga.array.length;
    },
    getAll:function(){
      return jsonDescarga.array;
    },
    addone:function(){
      jsonDescarga.array.push({
                                "home": "home"
                             });
    },
    reset:function(){
      jsonDescarga.array.length = 0;
    },
    addImages:function(arregloImagenes){
    	if (jsonImages.images.length == 0) {
    		jsonImages.images.push(arregloImagenes);
    	}
    },
    getImages:function(){
    	return jsonImages.images;
    },
    addoneArchivo:function(){
      jsonExisteArchivo.array.push({
                                "home": "home"
                             });
    },
    getAllArchivo:function(){
      return jsonExisteArchivo.array;
    }
  };

});